an SLA y la fecha de vencimiento. Al comenzar la apertura se muestra una ventana de selección de USUARIO.\r\n- Un ADMINISTRADOR es AGENTE también.\r\n- El CORREO saliente para notificaciones se configura en el apartado \"MTA por defecto\", escogido entre la lista de los dados de alta.\r\n- Cuando un ticket CADUCA simplemente es marcado como tal, pero esto ocurre si hay actividad en la web.\r\n- Desde la interfaz de USUARIO no se aprecia apenas ninguna diferencia entre un ticket RESUELTO o CERRADO. En ambos estados aparecen en la sección CERRADO, tanto para AGENTES como para USUARIOS, y estos últimos pueden reabrirlos publicando una respuesta.\r\n- Se pueden configurar los estados de los tickets y determinar en qué estados se pueden reabrir.\r\n- Cuando un agente cierra un ticket, éste le queda asignado. Sin embargo esto no sucede al reabrirlo.\r\n\r\n\r\n	PROPUESTAS\r\n\r\n- ¿Prioridad por tipos de tickets? ¿Más prioritario Incidencia que No Conformidad?\r\n- ¿Dejamos un campo \"Asunto\" en el formulario a modo de título? Facilita la presentación de la información.\r\n- Los mantenimientos se pueden programar con TAREAS asociadas a TICKETS.\r\n- Para caducidad de tickets:\r\n	· Establecemos una jerarquía de departamentos y aprovechamos el soporte que ya da la aplicación para establecer un gerente en cada uno de ellos, de manera que 	ante la caducidad de un ticket podamos asignar el ticket al gerente del departamento superior y al departamento en sí, si lo hay. \r\n	· Ante la caducidad de un ticket se notifica a la persona deseada en función del número de veces que ha caducado. Requiere apuntar contador de caducidades en cada ticket y orden de aviso en cada AGENTE.\r\n	NOTA: el perfil de gerente sólo existe para recibir notificaciones, no tiene funciones especiales.\r\n\r\n	\r\n	\r\n	PENDIENTE\r\n	\r\n- Identificadores de tickets con el año\r\n- Jerarquía de localizaciones (áreas y localizaciones)\r\n- Asignar como USUARIO un ticket directamente a un DEPARTAMENTO y a uno de sus AGENTES\r\n- Reasignar tickets atrasados\r\n\r\n\r\n\r\n	NOTIFICACIONES\r\n	\r\n- Asignación\r\n\r\n\r\n\r\n	IMPLEMENTADO\r\n	\r\n- Asignación de agente directamente por el usuario desde la apertura de ticket, con la notificación personalizada por correo al agente.\r\n- Caducidad de tickets con notificaciones consecutivas (varios SLAs por ticket).\r\n- Notificación por cierre de tickets al agente escogido.\r\n\r\n\r\n\r\n	BUGS\r\n	\r\n- En la búsqueda avanzada de tickets no siempre se llega a los resultados tras realizarla. En ocasiones se queda abierta la pestaña Abrir en lugar de la de Buscar, pese a que la búsqueda está correcta.'),(4,0,'Antonio				-> tritium@juntaex.es\r\nMª Ángeles			-> eco2cir@gmail.com\r\nJuan				-> ratvapc@gmail.com\r\nPepe				-> eco2cir@juntaex.es\r\nDavid				-> \r\nJose				-> rat_va_pc@juntaex.es\r\nManolo				-> '),(5,0,'%PDF-1.5\r%\\\\\r\n572 0 obj\r<</Linearized 1/L 863092/O 574/E 152431/N 29/T 861796/H [ 2373 1485]>>\rendobj\r          \r\n1215 0 obj\r<</DecodeParms<</Columns 5/Predictor 12>>/Filter/FlateDecode/ID[<DD59E32BE80AEB9CB9C2C0A1FD764C7E><DA4F8495E0CB8745AFE100FFDA9D0F08>]/Index[572 667]/Info 571 0 R/Length 991/Prev 861797/Root 573 0 R/Size 1239/Type/XRef/W[1 3 1]>>stream\r\nh\ė\JTQ\>~\Eu]=@7@tQ\U\\x^3(FPd\g\\h\EeDQfYh_y\ڴ\#\ug\\k\1Md́(Es&ţ)Ks$\\)vyV\\"\\WD.	lď\E\l\"}\m\C\\a\\^j*\"\-=8\kL.{`kn7|M5\³c{z\\%\5\;+=\\-\'\/Z\ׂ/0\k9\%tM&\.\v*Vq\S˫~L	޺QIب\:s\ᶠ\h\n]5cX\;/#])bԅ[;|5\\\C^}U?j\G\f@-\\G򲯰ns11V\=\\4@۳\1}\\;hgc*\:x\0_:ʈ*\)^+u[\!{r\)\wM\ZI\ýڣm\v`k\1᣸\,naTIW	\褼J\xC\\\cL\ng,a\n5`\f3cCг{2s1Û	\3\7xOCϬ\v\F\f\7	\`B7\}\aC-l\n\\A]5(\w\\l1_R3R\\w?TLgU?\b&8\\Z^\rxX\2).~\n;A\\\\T1T-\2\K\\M|\j/:1uu]\\0\"T\\U\p\`A\mjA0A<_6|\\]\&D4Q-t-~-\O~P\\j\"\n\\'S\^L,.~F\v\\e_\r7\\\UnVjm\K1bpDk^\%m\~C~zS\\=dͫACyI2l\\'ly3#\9\gdZ\n4z\\}}.K\74p3\\Nb7]\r!p2w\\1\b/>kkxgvP4iOn\?\0j\r\nendstream\rendobj\rstartxref\r\n0\r\n%%EOF\